const UserAdd = () => import('@/views/user/UserAdd.vue')
const UserList = () => import('@/views/user/UserList.vue')
const Home = () => import('@/views/home/Home.vue')
const Centent = () => import('@/views/centent/Centent.vue')
const SiteInfo = () => import('@/views/site/SiteInfo.vue')
const Footer = () => import('@/views/site/Footer.vue')
const Focus = () => import('@/views/essay/Focus.vue')
const EssayList = () => import('@/views/essay/EssayList')

const routes = [
  {
    path: '/useradd',
    component: UserAdd,
    requireAdmin: true
  },
  {
    path: '/userlist',
    component: UserList,
    requireAdmin: true
  },
  {
    path: '/home',
    component: Home,
  },
  {
    path: '/centent',
    component: Centent
  },
  // {
  //   path: '/editnews/:id',
  //   component: EditNews
  // },
  {
    path: '/siteinfo',
    component: SiteInfo
  },
  {
    path: '/footer',
    component: Footer
  },
  {
    path: '/focus',
    component: Focus
  },
  {
    path: '/essaylist',
    component: EssayList
  }
]

export default routes
